import React from 'react'

const ListItem = ({transaction, onTransactionClick}) => {

    const handleClick = () => {
        onTransactionClick(transaction)
    }

    return (
        <div className="list-item">
            <li onClick={handleClick}>{transaction.date}</li>
        </div>
    )
}

export default ListItem
